INSERT INTO `oferta_educativa` VALUES (1,2,'licenciatura-en-psicopedagogia','LICENCIATURA EN PSICOPEDAGOGÍA','licenciatura_psicopedagogia_desktop.png','licenciatura_psicopedagogia_movil.png','top','https://www.youtube.com/embed/YCmxg4qF5o0','<p>La&nbsp;<strong><span class=\"c-blue text-bold\">\"LICENCIATURA EN PSICOPEDAGOG&Iacute;A\"</span></strong> del Instituto Mexicano de Psicooncolog&iacute;a, est&aacute; enfocada a la formaci&oacute;n de profesionales en las diversas &aacute;reas de la educaci&oacute;n, en la cual se analiza el proceso educativo y sus caracter&iacute;sticas, empleando diferentes enfoques, instrumentos, metodolog&iacute;as y t&eacute;cnicas actuales en las &aacute;reas de la pedagog&iacute;a y la psicolog&iacute;a, donde se elaboran ideas constructivas e innovadoras que conlleven al mejoramiento del proceso ense&ntilde;anza-aprendizaje, a trav&eacute;s de investigaciones en el &aacute;mbito social y educativo, donde la labor del psicopedagogo va m&aacute;s all&aacute; de un escenario escolar.</p>','3 años','Cuatrimestral','PLAN_DESTUDIOS_LICENCIATURA_PSICOPEDAGOGIA.pdf','LICENCIATURAS_TITULACION.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Psicopedagogia',0,'2024-09-25 16:08:44','2024-12-11 21:41:46'),(2,2,'licenciatura-en-gerontologia','LICENCIATURA EN GERONTOLOGÍA','licenciatura_gerontologia_desktop.png','licenciatura_gerontologia_movil.png','top','https://www.youtube.com/embed/M89TXTNgsW8','<p>La&nbsp;<strong><span class=\"c-blue text-bold\">\"LICENCIATURA EN GERONTOLOG&Iacute;A\"</span></strong>&nbsp;del Instituto Mexicano de Psicooncolog&iacute;a, est&aacute; enfocada a la formaci&oacute;n de profesionales en el &aacute;rea de estudio de los procesos de envejecimiento del adulto mayor dentro del marco del respeto a la dignidad del paciente.<br><br>Bas&aacute;ndose el estudio de los cambios f&iacute;sicos, biol&oacute;gicos, psicol&oacute;gicos y sociales del adulto mayor, donde es necesaria la investigaci&oacute;n de los cambios sociales relacionados con la vejez, as&iacute; como dise&ntilde;ar, aplicar e implementar proyectos y programas para el bienestar del adulto mayor que van desde sus necesidades, recursos, capacidades.</p>','3 años','Cuatrimestral','PLAN_DESTUDIOS_LICENCIATURA_GERONTOLOGIA.pdf','LICENCIATURAS_TITULACION.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Gerontologia',0,'2024-09-29 15:41:00','2024-12-11 21:41:57'),(3,2,'licenciatura-en-psicologia','LICENCIATURA EN PSICOLOGÍA','licenciatura_psicologia_desktop.png','licenciatura_psicologia_movil.png','bottom','https://www.youtube.com/embed/h3-2bhXJIs4','<p>La&nbsp;<strong><span class=\"c-blue text-bold\">\"LICENCIATURA EN PSICOLOG&Iacute;A\"</span></strong>&nbsp;del Instituto Mexicano de Psicooncolog&iacute;a, est&aacute; enfocada a la formaci&oacute;n de profesionales en el &aacute;rea de la salud mental dentro del marco del respeto a la dignidad del paciente.<br><br>Donde se forma al psic&oacute;logo con conocimientos te&oacute;rico-pr&aacute;cticos, en los cuales sean capaces de analizar e integrar los determinantes del comportamiento del ser humano, con el fin de prever, diagnosticar, investigar y aplicar procedimientos de intervenci&oacute;n para su estudio, que van desde las &aacute;reas cl&iacute;nica, educativa, laboral y social.</p>','3 años','Cuatrimestral','PLAN_DESTUDIOS_LICENCIATURA_PSICOLOGIA.pdf','LICENCIATURAS_TITULACION.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Psicologia',0,'2024-09-29 15:46:34','2024-12-11 21:41:18'),(4,2,'licenciatura-en-trabajo-social','LICENCIATURA EN TRABAJO SOCIAL','licenciatura_trabajo_social_desktop.png','licenciatura_trabajo_social_movil.png','top','https://www.youtube.com/embed/x5Nldp2woDU','<p>La&nbsp;<strong><span class=\"c-blue text-bold\">\"LICENCIATURA EN TRABAJO SOCIAL\"</span></strong>&nbsp;del Instituto Mexicano de Psicooncolog&iacute;a, est&aacute; enfocada a la formaci&oacute;n de profesionales de forma integral, mediante la utilizaci&oacute;n de teor&iacute;as acerca del comportamiento humano y sistemas sociales, en donde las personas interact&uacute;an con su entorno, que le permiten enfrentar la problem&aacute;tica actual y futura que se suceden en la sociedad.<br><br>Promoviendo el bienestar social de la poblaci&oacute;n en los diversos sectores donde se desempe&ntilde;e, dentro del marco del respeto a la dignidad.</p>','3 años','Cuatrimestral','PLAN_DESTUDIOS_LICENCIATURA_TRABAJO SOCIAL.pdf','LICENCIATURAS_TITULACION.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Trabajo Social',0,'2024-09-29 16:45:54','2024-12-11 21:42:19'),(5,2,'licenciatura-en-derecho','LICENCIATURA EN DERECHO','licenciatura_derecho_desktop.png','licenciatura_derecho_movil.png','center','https://www.youtube.com/embed/R3PHCL9stFU','<p>Al finalizar los estudios de la&nbsp;<strong><span class=\"c-blue text-bold\">\"LICENCIATURA EN DERECHO\"</span></strong> el alumno identificar&aacute;, comprender&aacute; y aplicar&aacute; los elementos del derecho, en su desarrollo profesional, adquiriendo los conocimientos, habilidades y actitudes que le permitan explicar la normatividad y legislaci&oacute;n correspondiente al fen&oacute;meno jur&iacute;dico; as&iacute; como la integraci&oacute;n de la defensa jur&iacute;dica de las personas, la preservaci&oacute;n de las garant&iacute;as individuales y sus derechos ante los &oacute;rganos judiciales, nacionales e internacionales; y la habilidad de discriminar la problem&aacute;tica concerniente a cada una de las ramas del derecho y su aplicaci&oacute;n en la legislaci&oacute;n mexicana.</p>','3 años','Cuatrimestral','PLAN_DESTUDIOS_LICENCIATURA_DERECHO.pdf','LICENCIATURAS_TITULACION.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Derecho',0,'2024-09-29 18:10:18','2024-12-11 21:42:28'),(6,2,'licenciatura-en-administracion-y-finanzas','LICENCIATURA EN ADMINISTRACIÓN Y FINANZAS','licenciatura_administracion_finanzas_desktop.png','licenciatura_administracion_finanzas_movil.png','center','https://www.youtube.com/embed/CsrYz2UzlnY','<p>Formar profesionales con gran capacidad en la toma de decisiones en las organizaciones, atendiendo a las alternativas que se le presenten en el estudio de los procesos productivos y de servicios, as&iacute; como en la selecci&oacute;n de alternativas tecnol&oacute;gicas viables que garanticen el &eacute;xito empresarial.<br><br>Proporcionar al estudiante una formaci&oacute;n integral basada en la conjugaci&oacute;n de los conocimientos te&oacute;ricos de la Ciencia Administrativa y las Finanzas, con aquellos adquiridos en la pr&aacute;ctica, lo que le permita el mejor desempe&ntilde;o profesional.<br><br>Dotar al alumno de los mejores conocimientos administrativos que sean generadores de innovaci&oacute;n para lograr la alta productividad y desarrollo de la organizaci&oacute;n.</p>','3 años','Cuatrimestral','PLAN_DESTUDIOS_LICENCIATURA_ADMINISTRACION Y FINANZAS.pdf','LICENCIATURAS_TITULACION.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Administracion y Finanzas',0,'2024-09-29 20:15:30','2024-12-11 21:40:34'),(7,2,'licenciatura-en-informatica-administrativa','LICENCIATURA EN INFORMÁTICA ADMINISTRATIVA','licenciatura_informatica_administrativa_desktop.png','licenciatura_informatica_administrativa_movil.png','top','https://www.youtube.com/embed/stq0mkq3d5w','<p>La&nbsp;<strong><span class=\"c-blue text-bold\">\"LICENCIATURA EN INFORM&Aacute;TICA ADMINISTRATIVA\"</span></strong> tiene como misi&oacute;n formar profesionistas capaces de dise&ntilde;ar e implantar soluciones basadas en sistemas de informaci&oacute;n que faciliten la toma de decisiones y agilicen las operaciones propias de una organizaci&oacute;n. Esta labor debe adaptarse a los avances tecnol&oacute;gicos y cambios socio-econ&oacute;micos a nivel nacional e internacional.</p>','3 años','Cuatrimestral','PLAN_DESTUDIOS_LICENCIATURA_INFORMATICA ADMINISTRATIVA.pdf','LICENCIATURAS_TITULACION.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Informatica Administrativa',0,'2024-09-29 20:39:29','2024-12-11 21:42:36'),(8,2,'licenciatura-en-ciencias-de-la-comunicacion','LICENCIATURA EN CIENCIAS DE LA COMUNICACIÓN','licenciatura_ciencias_comunicacion_desktop.png','licenciatura_ciencias_comunicacion_movil.png','center','https://www.youtube.com/embed/sqv9rRZtVJY','<p>La&nbsp;<strong><span class=\"c-blue text-bold\">\"LICENCIATURA EN CIENCIAS DE LA COMUNICACI&Oacute;N\"</span></strong> del Instituto Mexicano de Psicooncolog&iacute;a, est&aacute; enfocada a la formaci&oacute;n de licenciados en comunicaci&oacute;n con un amplio conocimiento cr&iacute;tico y metodol&oacute;gico, teniendo la capacidad de innovar en las diferentes &aacute;reas de la comunicaci&oacute;n, (period&iacute;sticas, publicitarias, medios de comunicaci&oacute;n tradicional y digital).</p>','3 años','Cuatrimestral','PLAN_DESTUDIOS_LICENCIATURA_CIENCIAS DE LA COMUNICACION.pdf','LICENCIATURAS_TITULACION.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Ciencias de la Comunicación',0,'2024-09-29 20:43:40','2024-12-11 21:42:43'),(9,3,'maestria-en-tanatologia','MAESTRÍA EN TANATOLOGÍA','maestria_tanatologia_desktop.png','maestria_tanatologia_movil.png','bottom',NULL,'<p>El inter&eacute;s por la calidad de vida y la muerte digna, han llevado al Instituto Mexicano de Psicooncolog&iacute;a a crear la&nbsp;<strong><span class=\"c-blue text-bold\">\"MAESTR&Iacute;A EN TANATOLOG&Iacute;A\"</span></strong>&nbsp;donde se forman a profesionales que est&eacute;n capacitados para analizar estos sucesos desde la esfera biol&oacute;gica, psicol&oacute;gica y social, a partir de la valoraci&oacute;n de las tradiciones, creencias, lenguaje y manifestaciones, producto de la espiritualidad del ser humano basando su pr&aacute;ctica profesional en la normatividad reguladora de los acontecimientos, desarrollando investigaciones comprometidas a propiciar la calidad, goce y plenitud de vida de los seres humanos, tomando en cuenta el principio del bien vivir y en consecuencia del bien morir.<br><br>As&iacute; mismo ampliar los conocimientos en el &aacute;rea de estudio de la&nbsp;<strong><span class=\"c-blue text-bold\">\"TANATOLOG&Iacute;A\"</span></strong>, que a trav&eacute;s de su implementaci&oacute;n en la pr&aacute;ctica y de una selecci&oacute;n de estrategias educativas viables, conduci&eacute;ndose as&iacute; con &eacute;tica y responsabilidad en la dif&iacute;cil tarea de educar para la muerte, respetando los derechos individuales del ser humano en circunstancias de muerte y de llegar a la etapa final de su vida dignamente y facilitar as&iacute; el proceso de duelo en su entorno.</p>','25 meses','Cuatrimestral','PLAN_DE_ESTUDIOS_MAESTRIA_TANATOLOGIA.pdf','MAESTRIA_TITULACION_TANATOLOGIA.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Tanatologia',0,'2024-09-29 20:46:40','2024-12-11 21:42:51'),(10,3,'maestria-en-psicoterapia-transpersonal-integrativa','MAESTRÍA EN PSICOTERAPIA TRANSPERSONAL INTEGRATIVA','maestria_psicoterapia_transpersonal_integrativa_desktop.png','maestria_psicoterapia_transpersonal_integrativa_movil.png','center',NULL,'<p>En la&nbsp;<strong><span class=\"c-blue text-bold\">\"MAESTR&Iacute;A EN PSICOTERAPIA TRANSPERSONAL INTEGRATIVA\"</span></strong>&nbsp;que ofrece el Instituto Mexicano de Psicooncolog&iacute;a, el egresado ser&aacute; capaz de:<br><br>Analizar, proponer y emplear m&eacute;todos, sistemas y t&eacute;cnicas psicoterap&eacute;uticas enfocadas al tratamiento integral y hol&iacute;stico de las personas en aspectos intelectuales, corporales, espirituales y de autorrealizaci&oacute;n; haciendo uso de sus conocimientos en psicofisiolog&iacute;a, teor&iacute;as de la personalidad, postulados te&oacute;ricos de la filosof&iacute;a existencialista, los enfoques religiosos centrados en bienestar de la persona, psicoterapia de grupo, m&eacute;todos de inducci&oacute;n a la psicoterapia de la expresi&oacute;n emotiva, t&eacute;cnicas de logoterapia y los procesos y etapas del duelo. Con el fin de generar procesos psicoterap&eacute;uticos que permitan desechar conductas condicionadas por el ego y proporcionar mayor libertad en el momento de decidir o actuar, de tal manera trascender el sufrimiento y exponenciar la actitud creativa del ser humano.<br><br><span style=\"font-size: 14pt; color: #3598db;\"><strong><span class=\"fs-1_25 c-green-2\">Para ingresar a la Maestr&iacute;a, es requisito entrevista previa.</span></strong></span></p>','25 meses','Cuatrimestral','PLAN_DE_ESTUDIOS_MAESTRIA_PSICOTERAPIA TRANSPERSONAL INTEGRATIVA.pdf','MAESTRIA_TITULACION_PSICOTERAPIA TRANSPERSONAL.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Psicoterapia Transpersonal Integrativa',0,'2024-09-29 21:03:14','2024-12-11 21:42:59'),(11,3,'maestria-en-psicooncologia','MAESTRÍA EN PSICOONCOLOGÍA','maestria_psicooncologia_desktop.png','maestria_psicooncologia_movil.png','top','https://www.youtube.com/embed/kFp0CnOgMjY','<p>Con el fin de establecer una red de atenci&oacute;n psicol&oacute;gica e interesada en encauzar de forma saludable el proceso de duelo, el Instituto Mexicano de Psicooncolog&iacute;a ha creado la&nbsp;<strong><span class=\"c-blue text-bold\">\"MAESTR&Iacute;A EN PSICOONCOLOG&Iacute;A\"</span></strong>&nbsp;con el objetivo de cubrir las necesidades de cada paciente oncol&oacute;gico, aumentando la calidad de vida, y hacer prevenci&oacute;n de las posibles complicaciones bio-psico-sociales.<br><br>El patr&oacute;n de las causantes de la mortalidad ha propiciado un cambio en el modelo m&eacute;dico de entender y tratar la enfermedad, se ha pasada del modelo biom&eacute;dico al modelo bio-psico-social. El cual postula que los estados de salud y enfermedad son el resultado de la interacci&oacute;n de factores biol&oacute;gicos, psicol&oacute;gicos y sociales.</p>','25 meses','Cuatrimestral','PLAN_DE_ESTUDIOS_MAESTRIA_PSICOONCOLOGIA.pdf','MAESTRIA_TITULACION_PSICOONCOLOGIA.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Psicooncologia',0,'2024-09-29 21:03:48','2024-12-11 21:43:15'),(12,3,'maestria-en-derecho-familiar','MAESTRÍA EN DERECHO FAMILIAR','maestria_derecho_familiar_desktop.png','maestria_derecho_familiar_movil.png','center','https://www.youtube.com/embed/S0USGlnY560','<p>Al finalizar los estudios de la Maestr&iacute;a, el alumno realizar&aacute; la identificaci&oacute;n, comprensi&oacute;n y aplicaci&oacute;n de los elementos del derecho familiar, a su desarrollo profesional.</p>','2 años','Cuatrimestral','PLAN_DE_ESTUDIOS_MAESTRIA_DERECHO FAMILIAR.pdf','MAESTRIA_TITULACION_DERECHO FAMILIAR.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Derecho Familiar',0,'2024-09-29 21:03:49','2024-12-11 21:43:26'),(13,3,'maestria-en-derecho-penal','MAESTRÍA EN DERECHO PENAL','maestria_derecho_penal_desktop.png','maestria_derecho_penal_movil.png','center','https://www.youtube.com/embed/1Mm8r-mIO1I','<p>Al finalizar los estudios de la Maestr&iacute;a, el alumno realizar&aacute; la identificaci&oacute;n, comprensi&oacute;n y aplicaci&oacute;n de los elementos del Derecho Penal, a su desarrollo profesional.</p>','2 años','Cuatrimestral','PLAN_DE_ESTUDIOS_MAESTRIA_DERECHO PENAL.pdf','MAESTRIA_TITULACION_DERECHO PENAL.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Derecho Penal',0,'2024-09-29 21:03:49','2024-12-11 21:43:34'),(14,3,'maestria-en-comercio-exterior','MAESTRÍA EN COMERCIO EXTERIOR','maestria_comercio_exterior_desktop.png','maestria_comercio_exterior_movil.png','center','https://www.youtube.com/embed/PXzgHzv8GN0','<p>Al finalizar los estudios de la Maestr&iacute;a, el alumno realizar&aacute; la identificaci&oacute;n, comprensi&oacute;n y aplicaci&oacute;n de los elementos del Comercio Exterior, a su desarrollo profesional.</p>','2 años','Cuatrimestral','PLAN_DE_ESTUDIOS_MAESTRIA_COMERCIO EXTRIOR.pdf','MAESTRIA_TITULACION_COMERCIO EXTERIOR.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Comercio Exterior',0,'2024-09-29 21:03:50','2024-12-11 21:43:43'),(15,3,'maestria-en-educacion','MAESTRÍA EN EDUCACIÓN','maestria_educacion_desktop.png','maestria_educacion_movil.png','center','https://www.youtube.com/embed/JABCdOkeWkU','<p>Formar maestros en educaci&oacute;n que, a trav&eacute;s de las diversas posturas te&oacute;ricas educativas, pedag&oacute;gicas y de aprendizajes.</p>','1 año 8 meses','Cuatrimestral','PLAN_DE_ESTUDIOS_MAESTRIA_EDUCACION.pdf','MAESTRIA_TITULACION_EDUCACION.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Educacion',0,'2024-09-29 21:03:51','2024-12-11 21:43:51'),(16,3,'maestria-en-evaluacion-educativa','MAESTRÍA EN EVALUACIÓN EDUCATIVA','maestria_evaluacion_educativa_desktop.png','maestria_evaluacion_educativa_movil.png','center','https://www.youtube.com/embed/sNSeR7g44QM','<p>Diseñar, dirigir, ejecutar y supervisar programas y proyectos de evaluación educativa; elaborar criterios para la evaluación del aprendizaje, las prácticas de enseñanza, el currículum, las instituciones y las políticas educativas, con el fin de mejorar la calidad y fomentar la cultura evaluativa.<br><br>Seleccionar y categorizar estrategias y metodologías cuantitativas y cualitativas de investigación para diseñar un proyecto enfocado en los estudios de la evaluación educativa, con rigor metodológico, científico y el adecuado manejo del aparato crítico.</p>','1 año 8 meses','Cuatrimestral','PLAN_DE_ESTUDIOS_MAESTRIA_EVALUACION EDUCATIVA.pdf','MAESTRIA_TITULACION_EVALUACION EDUCATIVA.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Evaluacion Educativa',0,'2024-09-29 21:03:51','2024-12-11 21:43:59'),(17,3,'maestria-en-estudios-del-suicidio','MAESTRÍA EN ESTUDIOS DEL SUICIDIO','maestria_estudios_del_suicidio_desktop.png','maestria_estudios_del_suicidio_movil.png','top','https://www.youtube.com/embed/9fDVXNiBfXw','<p>Analizar e interpretar las teor&iacute;as psicol&oacute;gicas, sociol&oacute;gicas, existencialistas y antropol&oacute;gicas enfocadas en la fenomenolog&iacute;a del suicidio y la muerte, as&iacute; como los estudios tanatol&oacute;gicos; reconociendo la influencia de la cultura y la bio&eacute;tica en los procesos de aceptaci&oacute;n; considerando el manejo conductual y psicosocial de las enfermedades y los procesos del duelo, con la finalidad de dise&ntilde;ar, aplicar y evaluar programas y modelos para la prevenci&oacute;n del suicidio por medio de la detecci&oacute;n del riesgo en las diferentes etapas de la vida.<br><br>Seleccionar y categorizar estrategias y metodolog&iacute;as cuantitativas y cualitativas de investigaci&oacute;n para dise&ntilde;ar un proyecto enfocado en los estudios del suicidio, con rigor metodol&oacute;gico, cient&iacute;fico y el adecuado manejo del aparato cr&iacute;tico.</p>','1 año 8 meses','Cuatrimestral','PLAN_DE_ESTUDIOS_MAESTRIA_ESTUDIOS_DEL_SUICIDIO.pdf','MAESTRIA_TITULACION_ESTUDIOS DEL SUICIDIO.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Estudios del Suicidio',0,'2024-09-29 21:03:52','2024-12-11 21:44:12'),(18,4,'doctorado-en-tanatologia','DOCTORADO EN TANATOLOGÍA','doctorado_tanatologia_desktop.png','doctorado_tanatologia_movil.png','center','video/doc_tanatologia.mp4','<p>El Instituto Mexicano de Psicooncolog&iacute;a, es la primera instituci&oacute;n a nivel nacional en impartir el&nbsp;<strong><span class=\"c-blue text-bold\">\"DOCTORADO EN TANATOLOG&Iacute;A\"</span></strong>, el cual est&aacute; enfocado a la formaci&oacute;n de profesionales capaces de desarrollar investigaciones con rigor metodol&oacute;gico y cient&iacute;fico relacionadas con aspectos tanatol&oacute;gicos, en las diversas esferas biol&oacute;gica, psicol&oacute;gica, social y espiritual.<br><br>Mediante el an&aacute;lisis de la tanatolog&iacute;a, el duelo, la bio&eacute;tica, el suicidio, as&iacute; como los aspectos legales y religiosos de la muerte, con el fin de tener elementos para propiciar la calidad de vida en el paciente, familia y cuerpo m&eacute;dico tratante, tomando en cuenta el principio del&nbsp;<strong><span class=\"c-blue text-bold\">\"BIEN VIVIR Y EN CONSECUENCIA DEL BIEN MORIR\"</span></strong>.</p>','2 años','Semestral','PLAN_DESTUDIOS_DOCTORADO_TANATOLOGIA.pdf','DOCTORADO EN TANATOLOGIA.png','RVOES_PAGS_DERECHO_MONTEVIDEO_1FEBRERO2024.pdf',0,'Tanatologia',0,'2024-09-29 22:41:25','2024-12-11 21:44:21'),(19,1,'tecnico-en-administracion-de-recursos-humanos','Técnico en Administración de Recursos Humanos','bachillerato_recursos_humanos_desktop.png','bachillerato_recursos_humanos_movil.png','top',NULL,'<p><span class=\"c-blue fs-08\" style=\"font-size: 10pt;\">Incorporado a la Secretar&iacute;a de Educaci&oacute;n P&uacute;blica: Acuerdo N&uacute;mero 20171009, con fecha 22/Junio/2017, otorgado por la Subsecretar&iacute;a de Educaci&oacute;n Media Superior y la Direcci&oacute;n General de Educaci&oacute;n Tecnol&oacute;gica Industrial.</span><br><br>El T&eacute;cnico en Administraci&oacute;n de Recursos Humanos se desarrolla y ofrece las competencias profesionales que permiten al estudiante elaborar y gestionar documentaci&oacute;n administrativa referente a recursos humanos, integrar al personal a la organizaci&oacute;n, asistir en actividades de capacitaci&oacute;n, desarrollo y evaluaci&oacute;n del personal, as&iacute; como determinar las remuneraciones al personal. La malla curricular se caracteriza por tener un alto contenido pr&aacute;ctico, orientaci&oacute;n hacia el desarrollo de competencias para el trabajo, el sello distintivo de los profesionales formados en IMPo.<br><br><span class=\"c-blue\">CAMPO LABORAL</span><br>El T&eacute;cnico en Administraci&oacute;n de Recursos Humanos cuenta con los conocimientos para desempe&ntilde;arse en las siguientes competencias profesionales:<br><br>&bull; Elaborar y gestionar la informaci&oacute;n de la organizaci&oacute;n.<br>&bull; Integrar el capital humano a la organizaci&oacute;n.<br>&bull; Asistir en el control y evaluaci&oacute;n del desempe&ntilde;o del capital humano de la organizaci&oacute;n.<br>&bull; Controlar los procesos y servicios de higiene y seguridad del capital humano en la organizaci&oacute;n.<br>&bull; Determinar las remuneraciones al capital humano de la organizaci&oacute;n.</p>','3 años','Inicio de clases semestral','PLAN_DE_ESTUDIOS_BACHILLERATO_ADMINISTRACION_DE_RECURSOS_HUMANOS.pdf',NULL,NULL,0,'Bach. Tec. en Administracion de Recursos Humanos',0,'2024-09-29 22:41:26','2024-12-11 21:51:18'),(20,1,'tecnico-en-contabilidad','Técnico en Contabilidad','bachillerato_contabilidad_desktop.png','bachillerato_contabilidad_movil.png','center',NULL,'<p><span class=\"c-blue fs-08\" style=\"font-size: 10pt;\">Incorporado a la Secretar&iacute;a de Educaci&oacute;n P&uacute;blica: Acuerdo N&uacute;mero 20171006, con fecha 22/Junio/2017, otorgado por la Subsecretar&iacute;a de Educaci&oacute;n Media Superior y la Direcci&oacute;n General de Educaci&oacute;n Tecnol&oacute;gica Industrial.</span><br><br>El T&eacute;cnico en Contabilidad General es un T&eacute;cnico capacitado para realizar y administrar los procesos contables y tributarios de empresas y organizaciones. Ejercer sus funciones de acuerdo a los par&aacute;metros de calidad, las normas vigentes y los criterios de optimizaci&oacute;n de recursos, as&iacute; como la satisfacci&oacute;n de los clientes. La malla curricular se caracteriza por tener un alto contenido pr&aacute;ctico, orientaci&oacute;n hacia el desarrollo de competencias para el trabajo, el sello distintivo de los profesionales formados en IMPo.<br><br><span class=\"c-blue\">Campo Laboral</span><br>El t&eacute;cnico en Contabilidad cuenta con los conocimientos para desempe&ntilde;arse en las industrias de diversa naturaleza, empresas mineras, comerciales, empresas de fabricaci&oacute;n, financieras, servicios de servicios t&eacute;cnicos del rubro y en general en toda la instituci&oacute;n que requiere los procesos contables. Las competencias adquiridas en su formaci&oacute;n lo capacitan, al mismo tiempo, para generar sus propios espacios de trabajo a trav&eacute;s de la creaci&oacute;n y gesti&oacute;n de microempresas de prestaci&oacute;n de servicios t&eacute;cnicos en las &aacute;reas contactables y tributarias.</p>','3 años','Inicio de clases semestral','Plan_de_estudio_Bachillerato_Contabilidad.pdf',NULL,NULL,0,'Bach. Tec. en Contabilidad',0,'2024-09-29 22:41:26','2024-12-11 21:51:28'),(21,1,'tecnico-en-trabajo-social','Técnico en Trabajo Social','bachillerato_trabajo_social_desktop.png','bachillerato_trabajo_social_movil.png','center',NULL,'<p><span class=\"c-blue fs-08\" style=\"font-size: 10pt;\">Incorporado a la Secretar&iacute;a de Educaci&oacute;n P&uacute;blica: Acuerdo N&uacute;mero 20171007, con fecha 22/Junio/2017, otorgado por la Subsecretar&iacute;a de Educaci&oacute;n Media Superior y la Direcci&oacute;n General de Educaci&oacute;n Tecnol&oacute;gica Industrial.</span><br><br>El T&eacute;cnico en Trabajo Social es un T&eacute;cnico con s&oacute;lidas competencias para operar en el &aacute;mbito del trabajo social con la comunidad, capacitado para trabajar en las organizaciones humanas, apoyado en el desarrollo profesional de la vida &uacute;til de las personas y promover su participaci&oacute;n social. La malla curricular se caracteriza por tener un alto contenido pr&aacute;ctico, orientaci&oacute;n hacia el desarrollo de competencias para el trabajo, el sello distintivo de los profesionales formados en IMPo.<br><br><strong><span class=\"c-blue text-bold\">CAMPO LABORAL</span></strong><br>La formaci&oacute;n de este t&eacute;cnico le permite desenvolverse asistencia personal en el &aacute;rea de servicios p&uacute;blicos, servicios orientados a menores, empresas privadas y todo tipo de organizaciones de beneficencia, y en general, en las &aacute;reas de bienestar o servicio social.<br><br>Las competencias adquiridas en su formaci&oacute;n le permiten, al mismo tiempo, el ejercicio independiente, a trav&eacute;s de la prestaci&oacute;n de servicios de asesor&iacute;a en el &aacute;rea.</p>','3 años','Inicio de clases semestral','Plan_de_estudio_Bachillerato_Trabajo_Social.pdf',NULL,NULL,0,'Bach. Tec. en Trabajo Social',0,'2024-09-29 22:41:26','2024-12-11 21:51:35'),(22,1,'tecnico-en-programacion','Técnico en Programación','bachillerato_programacion_desktop.png','bachillerato_programacion_movil.png','bottom',NULL,'<p><span class=\"c-blue fs-08\" style=\"font-size: 10pt;\">Incorporado a la Secretar&iacute;a de Educaci&oacute;n P&uacute;blica: Acuerdo N&uacute;mero 20171008, con fecha 22/Junio/2017, otorgado por la Subsecretar&iacute;a de Educaci&oacute;n Media Superior y la Direcci&oacute;n General de Educaci&oacute;n Tecnol&oacute;gica Industrial.</span><br><br>El t&eacute;cnico de Programaci&oacute;n es un profesional capacitado para desarrollar programas inform&aacute;ticos en lenguajes y plataformas inform&aacute;ticas est&aacute;ndar de la industria, incorporando en &eacute;l el an&aacute;lisis, dise&ntilde;o y construcci&oacute;n de soluciones inform&aacute;ticas. Su formaci&oacute;n, adem&aacute;s, lo habilit&oacute; para construir sistemas instalados en plataformas Internet con el apoyo de bases de datos. La malla curricular se caracteriza por tener un alto contenido pr&aacute;ctico, orientaci&oacute;n hacia el desarrollo de competencias para el trabajo, el sello distintivo de los profesionales formados en IMPo.<br><br><strong><span class=\"c-blue text-bold\">CAMPO LABORAL</span></strong><br>La reconocida formaci&oacute;n de este profesional, unida a las creyentes responsables en el &aacute;mbito de la inform&aacute;tica en el mundo entero, le permite insertar en todo tipo de empresas y organizaciones que operan con las plataformas inform&aacute;ticas y requiere el dise&ntilde;o, desarrollo, implementaci&oacute;n y evaluaci&oacute;n de software y sistemas de informacion. Las competencias adquiridas en su formaci&oacute;n lo capacitan, al mismo tiempo, para generar sus propias empresas inform&aacute;ticas en el &aacute;mbito de la consultor&iacute;a o de servicios globales TIC.</p>','3 años','Inicio de clases semestral','PLAN_DE_ESTUDIOS_BACHILLERATO_PROGRAMACION.pdf',NULL,NULL,0,'Bach. Tec. en Programacion',0,'2024-09-29 22:41:27','2024-12-11 21:51:42'),(27,4,'doctorado-en-derecho','DOCTORADO EN DERECHO','doctorado_derecho_desktop.png','doctorado_derecho_desktop.png','center',NULL,'','','',NULL,NULL,NULL,0,'Derecho',0,'2024-11-18 18:46:09','2024-12-11 21:44:28'),(28,4,'doctorado-en-informatica','DOCTORADO EN INFORMÁTICA','feria_prevencion_adicciones_2.png',NULL,'center','https://www.youtube.com/embed/rn_YodiJO6k?si=S9oHQGBX87-joEll','','3 años','Cuatrimestral','800x560_XVI_Congreso_Internacional_de_Tanatologia_y_5to_Congreso_de_Estudios_del_Suicidio_IMPo2024_2.png',NULL,NULL,0,'Informática',1,'2024-12-08 21:45:28','2024-12-11 23:34:25'),(29,4,'doctorado-en-pedagogia','DOCTORADO EN PEDAGOGIA',NULL,NULL,NULL,NULL,'','','',NULL,NULL,NULL,0,'Pedagogia',1,'2024-12-11 21:21:32','2024-12-11 23:34:26'),(30,4,'doctorado-en-fisica','DOCTORADO EN FISICA','Zephyrus GX550_1920x1080.jpg',NULL,'center','https://www.youtube.com/embed/eoAJh909eEY?si=XSaZRyzU6gdJaX0D','<p>&bull; Elaborar y gestionar la informaci&oacute;n de la organizaci&oacute;n.<br>&bull; Integrar el capital humano a la organizaci&oacute;n.<br>&bull; Asistir en el control y evaluaci&oacute;n del desempe&ntilde;o del capital humano de la organizaci&oacute;n.<br>&bull; Controlar los procesos y servicios de higiene y seguridad del capital humano en la organizaci&oacute;n.</p>','3 años','Cuatrimestral',NULL,NULL,NULL,1,'Física',0,'2024-12-11 23:27:28','2024-12-11 23:42:31');

